import React, { Component } from "react";
import "./style.css";
import Iframe from 'react-iframe';

const Photos = () => {
  return (
    <div className="photos">
    <Iframe url="https://snapwidget.com/embed/657245"
        width="100%"
        height="800px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
        allow="encrypted-media"
        allowFullScreen/>
    </div>
  );
};
export default Photos;
